import Hero from '../components/Hero';
import NavBar from '../components/NavBar';
import ImageSrc from "../asserts/Service.jpg"
import Footer from '../components/Footer';
export default function Service(){
    return(
        <>
            <NavBar/>
            {/* <h1>This is Service</h1> */}
            <Hero
                cName="hero-mid"
                src= {ImageSrc}
                title="Service"
                btnClass="hide"

            />
            
            <Footer/>
        </>
    );
}
